const updateParameters = (key, id, n) => {
    let checked = checkTheCheck(n)
    if (checked) {
        active_parameters["active_" + key].push(id)
    } else {
        active_parameters["active_" + key] = active_parameters["active_" + key].filter(item => item !== id)
    }
}
// Checks (haha), if the checkmark is displayed for a given id and returns true/false
const checkTheCheck = (n, on, off) => {
    let element = document.getElementById(n)
    if (on && !element.classList.contains("showCheck")) {
        element.classList.add("showCheck")
        return true
    } else if (on && element.classList.contains("showCheck")) {
        return false
    }
    if (off && element.classList.contains("showCheck")) {
        element.classList.remove("showCheck")
        return false
    } else if (off && !element.classList.contains("showCheck")) {
        return true
    }

    if (element.classList.contains("showCheck")) {
        element.classList.remove("showCheck")
        return false
    } else {
        element.classList.add("showCheck")
        return true
    }
}

// Filter parent function for removing non-selected data from master set
const selectData = () => {
	let params = active_parameters
	let data = all_data[active_category]
    // Assigns array of keys of passed in parameters
    let keys = Object.keys(params)
    // Loops through all keys, filtering values that don't share sibling value
    for (let i = 0; i < keys.length; i++) {
        data = keyFilter(params[keys[i]], data)
    }
    // Calculating number of non-selected groups
    let b = 0
    for (let i = 0; i < keys.length; i++) {
        if (params[keys[i]].length == 0) {
            b++
        }
    }
    // Removes all cases of non-selected values (e.g., no genders are selected, removes all points with gender)
    data = emptyDeadFilters(keys.length - b, data)
    makeDataGroups(data)
}

const keyFilter = (keys, data) => {
    let filteredData = []
    if (keys.length > 0) {
        for (let i = 0; i < keys.length; i++) {
            filteredData = filteredData.concat(dataFilter(keys[i], data))
        }
        return filteredData
    } else {
        return data
    }
}

const dataFilter = (keyn, data) => {
    let filteredData = []
    data.forEach(d => {
    	if (typeof(d["T"]) == 'string') {
    		d["T"] = d["T"].split(" ")
    	}
        if (d["T"].includes(keyn)) {
            filteredData.push(d)
        }
    })
    return filteredData
}

const emptyDeadFilters = (keys, data) => {
    let filteredData = []
    data.forEach(d => {
        if (d["T"].length <= keys) {
            filteredData.push(d)
        }
    })
    return filteredData
}

const makeDataGroups = (dataG) => {
    let labelNames = []
    let groups = []
    dataG.forEach(d => {
        d["T"] = d["T"].join(" ")
        if (!labelNames.includes(d["T"])) {
            labelNames.push(d["T"])
            groups.push({
                label: d["T"],
                data: []
            })
        }
        groups.find(group => group.label === d["T"]).data.push({
            x: d["Y"],
            y: d[active_metric],
            M: d["M"],
            F: d["F"],
            S: d["S"],
            T: d["T"]
        })

    })
    convertToChartObject(groups)
}

const changeStat = (id) => {
	scatterChart.data.datasets.forEach(dataset => {
		dataset["data"].forEach(data => {
			data.y = data[id]
		})
	})
	if (id == "M") {
		scatterChart.options.scales.yAxes[0].ticks.beginAtZero = true
		scatterChart.options.scales.yAxes[0].ticks.suggestedMax = 10
	} else {
		scatterChart.options.scales.yAxes[0].ticks.beginAtZero  = false
		scatterChart.options.scales.yAxes[0].ticks.suggestedMax = false
	}
	active_metric = id
	scatterChart.update()
}

const convertToChartObject = (data) => {
    for (let i = 0; i < data.length; i++) {
        let randColor = COLORS[i + scatterChart.data.datasets.length]
        if (data.length + scatterChart.data.datasets.length >= COLORS.length) {
            randColor = '#' + Math.random().toString(16).substr(-6);
        }
        data[i]["borderWidth"] = settings.borderWidth
        data[i]["showLine"] = settings.showLine
        data[i]["fill"] = settings.fill
        data[i]["lineTension"] = settings.lineTension
        data[i]["backgroundColor"] = randColor
        data[i]["borderColor"] = randColor
    }
    updateChart(data)
}

// Prevents repeat groups from being added to dataset
const updateChart = (data) => {
	let labels = []
	// Grabbing all current labels being used
	scatterChart.data.datasets.forEach(set => {
		labels.push(set["label"])
	})
	// Using current labels to determine what is not being used 
    data.forEach(d => {
        if (!labels.includes(d["label"])) {
            scatterChart.data.datasets.push(d)
        }
    })
    scatterChart.update()
}

// Clears global object
const clearGlobal = () => {
    active_parameters = {
        active_genders: [],
        active_pol: [],
        active_generation: []
    }
    CHECK_IDS.forEach(i => {
    	checkTheCheck(i,false, true)
    })
}

